Ekyna\Component\Commerce\Supplier\Model\SupplierInterface:
    supplier_1:
        __factory: { '@ekyna_commerce.supplier.repository::createNew': [] }
        name: TechData
        gender: 'mr'
        firstName: <firstName()>
        lastName: <lastName()>
        email: <safeEmail()>
        customerCode: SOME-CODE
        address: <generateAddress(@self)>
        currency: <currencyByCode('EUR')>
        #tax: TODO
        carrier: '@supplier_carrier_1'

